import React, {BrowserRouter as Router, Switch, Route} from 'react'
import Nav from './components/Nav'
import About from './components/About'
import Home from './components/Home'

function App() {
  return (
    <Router>
    <div className='App'>
      <Nav />
      <Route path='/about' component={About} />
    </div>
    </Router>
  );
}

export default App;
